                        [attr.aria-pressed]="hide">
                        <mat-icon>{{hide ? 'visibility_off' : 'visibility'}}</mat-icon>
                    </button>
                </mat-form-field>
            </mat-card-content>
            <button mat-raised-button color="primary" type="submit" [disabled]="form.invalid" data-testid="login-button">Submit</button>
            <p *ngIf="onError" class="error" data-testid="error-message">An error occurred</p>
        </form>
    </mat-card>
</div>

